ext":"We recently welcomed Explora Centro de Arte y Ciencia, an interactive center for science and arts, to The Clubhouse Network. As a member of The Clubhouse Network, Rinc\u00f3n Clubhouse at Explora joins our international community of more than 100 Clubhouses located in 19 countries, providing youth with life-changing opportunities for 26 years. This Clubhouse is the third in Panama City joining The Clubhouse @ Parroquia de F\u00e1tima and Clubhouse La Chorrera \u2013 UNESCO. We are grateful to Panama\u2019s National Secretariat of Science, Technology and Innovation (SENACYT) for their partnership and support in launching this new Clubhouse. Bienvenidos!\u2800\n...\u2800\nExplora is the first Interactive Science and Art Center in Panam\u00e1 where youth can gain knowledge and foster their explorational spirit using games and fun as their main tool. The center provides a unique opportunity for young people\u2013as well as their families, schools, and communities\u2013to learn, discover, experiment and create.\u2800\n...\u2800\nRead the full story at the link in our bio.\u2800\n...\u2800\n#theclubhousenetwork #wheretechnologymeetsimagination #youthempowerment #workforcedevelopment #stemeducation #globalimpact #explorapanama #panama #panamacity #explorandoseaprende #senacyt @senacyt @explora_panama"}}]},"shortcode":"B4SzPGJnVis","edge_media_to_comment":{"count":0},"comments_disabled":false,"taken_at_timestamp":1572548901,"dimensions":{"height":721,"width":1080},"display_url":"https://scontent-dus1-1.cdninstagram.com/v/t51.2885-15/e35/72786491_112443243333718_1454448905348256498_n.jpg?_nc_ht=scontent-dus1-1.cdninstagram.com\u0026_nc_cat=110\u0026oh=fe63828fdb77319fda36a73a70325308\u0026oe=5E7BA6BE","edge_liked_by":{"count":21},"edge_media_preview_like":{"count":21},"location":{"id":"213177281","has_public_page":true,"name":"Panama City, Panama","slug":"panama-city-panama"},"gating_info":null,"fact_check_overall_rating":null,"fact_check_information":null,"media_previ onfig_height":640}],"is_video":false,"accessibility_caption":"Image may contain: one or more people, people on stage, sky, basketball court, child and outdoor"}},{"node":{"__typename":"GraphImage","id":"2161802679475482730","edge_media_to_caption":{"edges":[{"node":{"text":"Jordan Daley, 18,  has been coming to the @flagshipclubhouse since he was ten years old. He first walked in when he walked by the Museum of Science and saw a big floating shark. Naturally, he had to go in to see what it was all about. He met coordinators from the Clubhouse and, because of their support, kept coming back for the next eight years. Now at eighteen, he looks forward to peer mentoring in the Clubhouse, continuing with the Clubhouse-to-Career/College (C2C) Pathways program and entering into the Alumni Network when he turns nineteen.\u2800\n...\u2800\nDuring his time at the Clubhouse, Jordan enjoyed stop-animation where he spent many hours working on projects with other members. Above all, he loved composing classical and contemporary music in the music studio. As a mentor, Jordan plans to come back to provide music theory workshops to other members and inspire them to create their own music scores.\u2800\n...\u2800\nHis full story is at the link our bio.\u2800\n...\u2800\n#TheClubhouseNetwork #FlagshipClubhouse #ClubhouseAlumni #bestbuy #workforcedevelopment #youthempowerment #stemeducation #wheretechnologymeetsimagination #internships #jobplacement"}}]},"shortcode":"B4ARBVQn7Bq","edge_media_to_comment":{"count":1},"comments_disabled":false,"taken_at_timestamp":1571926983,"dimensions":{"height":810,"width":1080},"display_url":"https://scontent-dus1-1.cdninstagram.com/v/t51.2885-15/e35/s1080x1080/72400517_691973051289762_3476447945605946107_n.jpg?_nc_ht=scontent-dus1-1.cdninstagram.com\u0026_nc_cat=106\u0026oh=4e3a91ca0d9dbcfbefe57d3f45754908\u0026oe=5E78D732","edge_liked_by":{"count":43},"edge_media_preview_like":{"count":43},"location":{"id":"343536631","has_public_page":true,"name":"
